css:
@-moz-document url-prefix("https://trello.com/b/"), url-prefix("http://trello.com/b/") {
body {
    background: #FFFFFF url("https://d78fikflryjgj.cloudfront.net/images/backgrounds/7a14a57fef9435b0def0f613d0114334/purty_wood_dark.png") repeat !important;
}

div.js-add-list.list-wrapper.mod-add.is-idle {
    box-shadow: 0 0 0 0 !important;
}

div.list.js-list-content, div.js-add-list.list-wrapper.mod-add {
    box-shadow: 0 2px 2px 0 rgba(0, 0, 0, 0.14), 0 1px 5px 0 rgba(0, 0, 0, 0.12), 0 3px 1px -2px rgba(0, 0, 0, 0.2) !important;
}
}
